/**
 * @param {string} s
 * @return {number}
 */
var maxOperations = function(s) {
    let ans = 0
    for (let i = 0, count1 = 0; i <= s.length; i++) {
        if ((i === s.length || s[i] === '1') && s[i - 1] === '0') ans += count1
        if (s[i] === '1') count1++
    }
    return ans
};
